//   link1Url: "/",
//   link2Url: "/products",
//   link3Url: "/contact",
//   link4Url: "/about",
//   link1Size: "1.3vmax",
//   link1Color: "rgba(35, 35, 35,0.8)",
//   nav1justifyContent: "flex-end",
//   nav2justifyContent: "flex-end",
//   nav3justifyContent: "flex-start",
//   nav4justifyContent: "flex-start",
//   link1ColorHover: "#eb4034",
//   link1Margin: "1vmax",
//   profileIconUrl: "/login",
//   profileIconColor: "rgba(35, 35, 35,0.8)",
//   searchIconColor: "rgba(35, 35, 35,0.8)",
//   cartIconColor: "rgba(35, 35, 35,0.8)",
//   profileIconColorHover: "#eb4034",
//   searchIconColorHover: "#eb4034",
//   cartIconColorHover: "#eb4034",
//   cartIconMargin: "1vmax",
// };

const Header = () => {
  return (<>
    <>
      <header className="main-header">
        <marquee className="note">
          new notepads waiting for you to not(e)ice them!
        </marquee>
        <div>
          {/* <div class="main__header--pricks"> */}
          <a href="/" className="main-header__pricks">
            pricklybypb
          </a>
          {/* </div> */}
          {/* <nav class="main-nav"> */}
          <div className="bar">
            <i className="fa-solid fa-bars"></i>
            <i className="fa-solid fa-xmark" id="hdcross"></i>
          </div>
          <div className="headerbar">
            <ul className="main-nav__items--small">
              <li className="main-nav__item--small">
                <a href="./index.html">home</a>
              </li>
              <li className="main-nav__item--small">
                <a href="./categories/categories.html" class="shop">shop</a>
              </li>
              <li className="main-nav__item--small">
                <a href="./community/community.html">community</a>
              </li>
              <li className="main-nav__item--small">
                <a href="">about us</a>
              </li>
              <li className="main-nav__item--small" ><a href="./login/login.html">login</a>
              </li>
              <li className="main-nav__item--small">
                <a href="">search</a>
              </li>
              <li className="main-nav__item--small">
                <a href="./account/account.html">my account</a>
              </li>
              <li className="main-nav__item--small">
                <a href="./cart/cart.html"><img src="../images/cart__img.png" alt="" class="cart__icon" /></a>
              </li>
            </ul>
          </div>
          <ul className="main-nav__items">
            <li className="main-nav__item">
              <a href="/">home</a>
            </li>
            <li className="main-nav__item">
              <a href="/products" className="shop">
                shop
              </a>
            </li>
            <li className="main-nav__item">
              <a href="/about">community</a>
            </li>
            {/* <li className="main-nav__item">
              <a href="">about us</a>
            </li> */}
            <li className="main-nav__item">
              <a href="/account">my account</a>
            </li>
            <li className="main-nav__item">
              <a href="/cart">
                <img src="../images/cart__img.png" alt="" className="cart__icon" />
              </a>
            </li>
          </ul>
          {/* </nav> */}
        </div>
      </header>
      <main>
        <div className="popup">
          <div>
            <div className="popup__box">
              <div className="popup__box--h1">
                <h1>Love rant sessions?</h1>
                <h1>us too...</h1>
              </div>
              <div className="popup__box--h3">
                <h3>
                  <span className="letter--1">s</span>
                  <span className="letter--2">o</span>
                  <span className="letter--3">w</span>
                  <span className="letter--4">h</span>
                  <span className="letter--5">y</span>
                  <span className="letter--6">n</span>
                  <span className="letter--7">o</span>
                  <span className="letter--8">t</span>
                  <span className="letter--9">d</span>
                  <span className="letter--10">o</span>
                  <span className="letter--11">i</span>
                  <span className="letter--12">t</span>
                  <span className="letter--13">t</span>
                  <span className="letter--14">o</span>
                  <span className="letter--15">g</span>
                  <span className="letter--16">e</span>
                  <span className="letter--17">t</span>
                  <span className="letter--18">h</span>
                  <span className="letter--19">e</span>
                  <span className="letter--20">r</span>
                </h3>
              </div>
              <div className="popup__box--p">
                <p>
                  subscribe to our news letter for weekly rant sessions, exclusive
                  shop updates and (sshh don't tell anyone) discount codes
                </p>
              </div>
              <div>
                <a href="" className="btn popup__box--button">
                  subscribe now
                </a>
              </div>
            </div>
          </div>
        </div>
      </main>

    </>
  </>)
  // <ReactNavbar {...options} />;
};

export default Header;
